import React, {useContext, useEffect} from 'react'
import HarvestPhotos from './Harvest'
import HarvestContext from '../context/HarvestProvider'
import UserContext from '../context/UserProvider'





const HarvestList=(props) =>{

const {harvests} = useContext(HarvestContext)  


    useEffect(()=>{

        props.getAllHarvests()



        }, []
    )       

    console.log(harvests)

    return(
        <div>

            <h1>Current Available Harvests</h1>
            {harvests.map(harvest => <HarvestPhotos image={harvest.harvestImg} label={harvest.body} farmer={harvest.userHandle} { ...harvest} 
            key={Math.floor(Math.random()* Math.floor(1000))}/>  )}
        </div>
    )
}

export default HarvestList
